<!DOCTYPE html><html><head>
  <meta charset="utf-8">

  <title>
    CoffePack
  </title>

  <!--http://www.html5rocks.com/en/mobile/mobifying/-->
  <meta name="viewport" content="width=device-width,user-scalable=no,initial-scale=1,minimum-scale=1,maximum-scale=1,minimal-ui=true">

  <!--https://developer.apple.com/library/safari/documentation/AppleApplications/Reference/SafariHTMLRef/Articles/MetaTags.html-->
  <meta name="apple-mobile-web-app-capable" content="yes">
  <meta name="apple-mobile-web-app-status-bar-style" content="black-translucent">
  <meta name="format-detection" content="telephone=no">

  <!-- force webkit on 360 -->
  <meta name="renderer" content="webkit">
  <meta name="force-rendering" content="webkit">
  <!-- force edge on IE -->
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">
  <meta name="msapplication-tap-highlight" content="no">

  <!-- force full screen on some browser -->
  <meta name="full-screen" content="yes">
  <meta name="x5-fullscreen" content="true">
  <meta name="360-fullscreen" content="true">

  <!--fix fireball/issues/3568 -->
  <!--<meta name="browsermode" content="application">-->
  <meta name="x5-page-mode" content="app">
  <!--<link rel="apple-touch-icon" href=".png" />-->
  <!--<link rel="apple-touch-icon-precomposed" href=".png" />-->

  

  <script>
    function getMobileOS() {
      var e = navigator.userAgent || navigator.vendor || window.opera;
      return /android|Android/i.test(e) ? "android" : /iPad|iPhone|iPod|Macintosh/.test(e) && !window.MSStream ? "iOS" : "android";
    }
    function getUrlStore() {
      var clickTag = "https://play.google.com/store/apps/details?id=com.coffeeplease.packingpuzzle&gl=us";
      if (getMobileOS() == "iOS") {
        clickTag = "https://apps.apple.com/us/app/coffee-please-sort-puzzle/id6667101094";
      }
      return clickTag;
    }
    function openStoreTemp() {
      let url = getUrlStore();
      console.log(url);

      console.log("install");
      window.gameEnd && window.gameEnd();

      //If ad network is tiktok
      if (typeof (playableSDK) != "undefined") {
        window.playableSDK.openAppStore();
        return;
      }

      //If ad network is facebook
      if (typeof (FbPlayableAd) != "undefined") {
        FbPlayableAd.onCTAClick();
        return;
      }

      // If ad network is google ads
      if (typeof (ExitApi) != "undefined") {
        ExitApi.exit();
        return;
      }

      // If ad netwrok is ironsources
      if (typeof (dapi) != "undefined") {
        dapi.openStoreUrl();
        return;
      }

      // If ad network support MRAID 2.0
      if (typeof (mraid) != "undefined") {
        mraid.open(url);
        return;
      }
      // If ad network is mindwork. window alway avaiable so skip undefined check
      window.install && window.install();

      window.open(url);
    }

  </script>

  <script>
    function gameStart() { };
    function gameClose() { };
  </script>

body, canvas, div {
  display: block;

/* Remove spin of input type number */

    /* display: none; <- Crashes Chrome on hover */

}

body {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  padding: 0;

  margin: 0;

  cursor: default;
  color: #888;

  text-align: center;

  display: flex;

canvas {

}

  --safe-top: env(safe-area-inset-top);
  --safe-right: env(safe-area-inset-right);
  --safe-bottom: env(safe-area-inset-bottom);
  --safe-left: env(safe-area-inset-left);
}
